        private async void GetObicen(Guid taskId)
        {

            viewModel.VisibleLoad = true;
            viewModel.LoadingMessage = "";

            bool isSuccess = await GetTask(taskId);

            viewModel.VisibleLoad = false;
            if (isSuccess)
            {
                viewModel.LoadingMessage = "Success";
            }
            else
            {
                viewModel.VisibleLoad = false;
                Common.Instance.ShowToastMessage("Your session has expired!", DoubleResources.DangerSnackBar);
            }
        }

        private async Task<bool> GetTask(Guid taskId)
        {
            try
            {
                task = await TasksService.GetTask(taskId);

                if (task != null)
                {
                    var width = Application.Current.MainPage.Width - 50;
                    var height = Application.Current.MainPage.Height;

                    // var item = new TaskDetailsViewModel
                    {
                        viewModel.Id = task.Id.ToString();
                        viewModel.Title = task.ItemNumberFullAndNameDisplayPreference;
                        viewModel.ProjectName = task.Project != null ? task.Project.ItemNumberFullAndNameDisplayPreference : "";
                        //viewModel.ProjectName = task.Project?.ItemNumberFullAndNameDisplayPreference ?? "";
                        viewModel.ProjectId = task.Project_Id;
                        //viewModel.//StartDate = task.Project.StartDateTimeUTC.Value,
                        //viewModel.//EndDate = task.Project.EndDateTimeUTC.Value,
                        //viewModel.//Duration = "(" + TimeSpan.FromSeconds(task.DurationSeconds.Value).Days + "d " + TimeSpan.FromSeconds(task.DurationSeconds.Value).Hours + "h)",
                        viewModel.Description = task.Description;
                        viewModel.ISWebViewVisible = task.Description.Length != 0 ? true : false;
                        viewModel.WorkStatus = task.WorkPercentCompleteType != null ? task.WorkPercentCompleteType.Name : "";
                        viewModel.WorkPercentCompleteType = task.WorkPercentCompleteType;
                        viewModel.WorkPercentComplete = task.WorkPercentComplete.Value;
                    };

                    Title = viewModel.ProjectName;



                    viewModel.Description = @"<style>body {font-family:'Open Sans', Arial, sans-serif;color:#828282;} </style>" + viewModel.Description;

                    viewModel.Duration = task.DurationString;// String.Format("({0}d {1}h)", duratonDays.ToString(), workHours.ToString());

                    if (task.StartDateTimeUTC != null)
                    {
                        viewModel.StartDate = task.StartDateTimeUTC.Value;
                    }
                    if (task.EndDateTimeUTC != null)
                    {
                        viewModel.EndDate = task.EndDateTimeUTC.Value;
                    }

                    viewModel.Description = viewModel.Description.Replace("<img ", "<img style='max-width: 100%;' ");

                    try
                    {
                        var RelatedItems = await ItemUtilityService.client.GetRelatedItemsAsync(task.Id.Value, null);

                        if (RelatedItems != null)
                        {
                            viewModel.RelatedItemsCount = RelatedItems.Count();
                        }
                    }
                    catch (Exception ex)
                    {

                    }

                    //viewModel = item;
                }
            }
            catch (Exception ex)
            {
                //AuthenticationService.Logout();
                return false;
            }
            return true;
        }
        private async void OnMarkAsComplete(object sender, EventArgs e)
        {

            viewModel.VisibleLoad = true;
            viewModel.LoadingMessage = "";
            try
            {
                //task.WorkPercentComplete = viewModel.WorkPercentComplete = 100;
                //var response = await TasksService.Save(task);

                var response = TasksService.client.UpdateWorkPercentComplete(task.Id.Value, 100);

                if (!response.HasErrors)
                {
                    //btnMarkAsComplete.IsVisible = false;
                    //txtStatus.Text = viewModel.WorkStatus = "Done";
                    Common.Instance.ShowToastMessage("Success mark as completed Task!", DoubleResources.SuccessSnackBar);
                }
                else
                    Common.Instance.ShowToastMessage("Error communication with server!", DoubleResources.DangerSnackBar);


            }
            catch (Exception ex)
            {
                Common.Instance.ShowToastMessage("Error communication with server!", DoubleResources.DangerSnackBar);
            }
            viewModel.LoadingMessage = "Success";
            viewModel.VisibleLoad = false;
        }

        
