        private async void OnUpdateStatus(object sender, EventArgs e)
        {
           

            MessagingCenter.Subscribe<TaskStatusPage, Guid>(this, "TaskStatusUpdated", async (obj, taskId) =>
            {
                GetObicen(taskId);

                MessagingCenter.Unsubscribe<TaskStatusPage, Guid>(this, "TaskStatusUpdated");
            });

            await Navigation.PushAsync(new TaskStatusPage(new Guid(viewModel.Id), viewModel.WorkPercentCompleteType));
        }

        async void EditItem_Clicked(object sender, EventArgs e)
        {

            MessagingCenter.Subscribe<NewTaskPage, Guid>(this, "TaskUpdated", async (obj, itemId) =>
            {
                if (itemId != Guid.Empty)
                    GetObicen(itemId); 

                MessagingCenter.Unsubscribe<NewTaskPage, Guid>(this, "TaskUpdated");
            });


            await Navigation.PushAsync(new NewTaskPage(new Guid(viewModel.Id)));
        }
